import { Component, OnInit } from '@angular/core';
import { DataService } from 'src/app/services/data.service';

@Component({
  selector: 'app-skill-list',
  templateUrl: './skill-list.component.html',
  styleUrls: ['./skill-list.component.css']
})
export class SkillListComponent implements OnInit{

  data_frontend:any;
  data_backend:any;
  data_others:any;
  data_languajes:any;

  constructor(private dataService:DataService){}

  ngOnInit(): void {
    this.dataService.getData().subscribe(dataService => {
      this.data_frontend = dataService.skills.frontend;
      this.data_backend = dataService.skills.backend;
      this.data_others = dataService.skills.others;
      this.data_languajes = dataService.skills.data_languajes;
    });
  }

